import React, { useState } from 'react'
import styled from 'styled-components';
import img from '../images/Experience_background.png'
import ExperienceComponent from '../subComponents/ExperienceComponent';
import HomeButton from '../subComponents/HomeButton';
import LogoComponent from '../subComponents/LogoComponent';
import Socialicons from '../subComponents/Socialicons';

const MainContainer = styled.div`

    background-size:cover;
    background-repeat:no-repeat;
    background-attachement:fixed;
    background-position:center;
    wdith:100vw;
    height:100vh;
    background: rgb(0,140,179);
    background: linear-gradient(90deg, rgba(0,140,179,1) 0%, rgba(2,178,226,1) 46%, rgba(0,212,255,1) 100%);
`
const Container = styled.div`

    width:100%;
    height:auto;
    position:relative;
    top:20;

`

const CardList = styled.div`
    display:flex;
    padding:3rem;

`

const Grid = styled.div`


`

function MyExperiencePage() {
    const [click,setClick ]= useState(true)
    return (
        <MainContainer>
            <Container>

                <LogoComponent/>
                <Socialicons/>
                <ExperienceComponent/>

            </Container>
        </MainContainer>
    );
}

export default MyExperiencePage
